import React, { useEffect } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import Table from "components/Table/Table";
import { Paper, makeStyles } from "@material-ui/core";
import Modal from "@material-ui/core/Modal";
import Button from "@material-ui/core/Button";
import { useHistory } from "react-router-dom";
import { fetchAllHealthTopics } from "apiRequests/common";

const useStyles = makeStyles((theme) => ({
  root: {
    margin: "auto",
    marginTop: theme.spacing(3),
    maxWidth: "80%",
    justify: "center",
  },
  button_yes: {
    backgroundColor: "#ed5e68",
    color: "#fff",
  },
  button_no: {
    backgroundColor: "#8388a4",
    marginLeft: "1rem",
    color: "#fff",
  },
}));

const modalStyle = {
  top: "50%",
  left: `50%`,
  transform: `translate(-50%, -50%)`,
};

const Profiles = ({ fetchAllHealthTopics }) => {
  const classes = useStyles();
  const history = useHistory();
  const [open, setOpen] = React.useState(false);

  useEffect(() => {
    // fetch health Topics
    fetchAllHealthTopics();
  }, []);

  const handleCreateProfileClick = () => {
    console.log("add clicked");
    history.push({
      pathname: `/profiles/create`,
    });
  };
  const handleEditProfileClick = () => {
    console.log("add clicked");
    history.push({
      pathname: `/profiles/edit`,
    });
  };
  const body = (
    <div style={modalStyle} className={classes.paper}>
      <p id="simple-modal-title">
        Are you sure, you want to delete this health topic?
      </p>
      <div>
        <Button
          variant="contained"
          className={classes.button_yes}
          // onClick={clickedYes}
        >
          Yes
        </Button>
        <Button
          variant="contained"
          className={classes.button_no}
          // onClick={handleClose}
        >
          No
        </Button>
      </div>
    </div>
  );

  return (
    <Paper className={classes.root}>
      <Table add={handleCreateProfileClick} edit={handleEditProfileClick} />
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="simple-modal-title"
        aria-describedby="simple-modal-description"
      >
        {body}
      </Modal>
    </Paper>
  );
};

Profiles.propTypes = {
  fetchAllHealthTopics: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  healthTopics: state.common.healthTopics,
});
const mapDispatchToProps = (dispatch) => ({
  fetchAllHealthTopics: () => dispatch(fetchAllHealthTopics()),
});

export default connect(mapStateToProps, mapDispatchToProps)(Profiles);
